import cube from '../../images/stlFiles/cube.stl'
export default function DesignInfo(){
    let param = useParams();
    let design=getDesigne(param.designInfo);
    let url="../../images/stlFiles/cube.stl"
    return(
        <div>
            <UserNav/>
        <div className="designInfo">
        <STLViewer
                model={cube}
                width={200}
                height={200}
                modelColor='green'
                backgroundColor='green'
                />
            <h3>{design.name}</h3>
            <p>{design.info}</p>

        </div>
        </div>
    )


}
